public void init()
{
    super();
    GlobalizationInstrumentationHelper::featureRun(GlobalizationConstants::FeatureReferenceIN00115, funcName());

    directTaxInquiry    = new DirectTaxInquiry_IN();
    taxInquiryArguments = element.args().parmObject();
    if (taxInquiryArguments)
    {
        element.setValues(taxInquiryArguments);
        element.design().caption(enum2str(taxInquiryArguments.parmTaxWithholdType()) + " " + "@SYS1084");
    }
    element.initSortList();
    element.updateDesign();
}

